import React, { useState } from 'react';

const App = () => {
  const [count , setcount] = useState(0);
  const [num , setnum] = useState(10);

  const increment = ()=>{
  
    setcount(count + 1)

  };
  return(
     <>
     <button onClick={increment}>
       click me
     </button>
     <h2>
       you clicked {count} times
     </h2>
  </>
  );
};

export default App;
